import { Box, Button, Container, TextField, Typography } from "@mui/material";

export default function Contacts() {
  return (
    <Container sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        Contattaci
      </Typography>

      <Typography variant="body1" sx={{ mb: 3 }}>
        Hai domande? Vuoi richiedere un preventivo? Compila il modulo oppure
        scrivici via WhatsApp.
      </Typography>

      <Box
        component="form"
        sx={{ display: "flex", flexDirection: "column", gap: 2, maxWidth: 500 }}
      >
        <TextField label="Name" variant="outlined" required></TextField>
        <TextField></TextField>
        <TextField></TextField>

        <Button></Button>
      </Box>
    </Container>
  );
}
